import Sidebar from './Sidebar'
 //import Sidebar from 'react-bootstrap-sidebar';

class CourseDashboard extends React.Component{
    
    render(){
        return(
            <Container fluid>
                <Row>
                    <Col xs={2} id="sidebar-wrapper">
                        <Sidebar/>
                    </Col>
                    <Col  xs={10} id="page-content-wrapper">
                        this is a test
                    </Col> 
                </Row>
            </Container>
        )
    }
}

